This is a new version of my program that I made recently called "RS2 Updater" this will download all available rs2 files for the client when they are changed or modified. My logic is that i can download the loader every 15 minutes and check the download list class for updates on any file, then if anything updated it gets downloaded and saved as the new file. I started it and I am trying to aim for least amount of heap used and cpu so all of the java ex threads have been disabled.

I have set the process handling part to use as little of cpu and memory as possible, i havent got into the downloading or checking the loader file yet, i just start it.

I just want to build something so I can keep track of anything that jagex does, I will implement indivdual cache file downloading I plan on completeting this atleast by next fri. (probably on wed. or less) but fri. is max.

I will probably use the bare minimum of the java i/o api (zip,baos,bais,etc...) because of heap allocation. I will probably init 1024 for io and really just class field heap (URL,File,RandomAccessFile).

The most memory this thing will probably ever use is 10,000k, right now it uses 568k.

After about 10 minutes it goes down to 592K! view the attachment (592k!!!.png)

im going to split all of the logic up into different classes in a little bit (buffering,socketio,fileio,etc...)

