	private static void closesocket()
	{
		if (socketout == null && socketin == null && socket == null)
			return;

		try
		{
			if (socketin != null)
				socketin.close();

			if (socketout != null)
				socketout.close();

			if (socket != null)
				socket.close();

		}
		catch (IOException x) { }
		socket = null;
		socketin = null;
		socketout = null;
	}

	private static void threadcheck(Thread t)
	{
		misc.sleep(1024L);
		sysgroup.enumerate(threadbuf);
		String s;
		String s1;
		Thread t1;
		ThreadGroup h;
		for (int n = 0; n != 1000; n++)
		{
			t1 = threadbuf[n];
			if (t1 != null && t1 != t)
				try
				{
					s = t1.getState().toString();
					if (s.equals("RUNNABLE") || s.equals("TERMINATED"))
						continue;

					s1 = t1.getName();
					if (s1.equals("main"))
					{
						t1.join(1024L);
						s = t1.getState().toString();
						if (s.equals("RUNNABLE") || s.equals("TERMINATED"))
							continue;

					}
					if (t1.getPriority() != 10)
						t1.setPriority(10);

					if (!s1.equals("Signal Dispatcher") || System.console() == null)
					{
						t1.interrupt();
						try
						{
							t1.stop();
						}
						catch (Throwable w) { }
						t1.join(1024L);
						s = t1.getState().toString();
						if (s.equals("RUNNABLE") || s.equals("TERMINATED"))
						{
							h = t1.getThreadGroup();
							if (h != null && h != sysgroup)
								h.destroy();

						}
					}
				}
				catch (Throwable w) { }

		}

	}

	public static void main(String[] s)
