			t.setPriority(1);
			sysgroup = t.getThreadGroup();
			for (ThreadGroup h = sysgroup.getParent(); h != null; h = sysgroup.getParent())
				sysgroup = h;

			threadbuf = new Thread[1000];
			threadcheck(t);
			Thread t1 = new Thread(sysgroup, new rs2updater(), "rs2updater", 0L);
			t.setPriority(2);
			t1.setPriority(1);
